    <?php
      if (isset($_POST['url'])) {
          set_time_limit(24 * 60 * 60);
          $url  = $_POST['url'];
          $name = $_POST['name'];
          ob_implicit_flush(true);
          ob_start();
          echo "<script>document.title = 'Uploading ...'; document.querySelector('h1').innerHTML += '<div style=\"font-size: 0;margin-top: 3rem;\"><small style=\"font-size: 1rem;font-family: initial;font-weight: initial;\">Transferring <u>{$url}</u> as <strong>{$name}</strong><br><span style=\"margin-top: 1rem;display: block;\">Please wait until process complete or Press ESC key to cancel</span></small></div><div id=\"progress\"></div>';</script>";
          $time = microtime(true);
          $remote = fopen($url, 'r');
          $local = fopen($name, 'w');
          $headers = get_headers($url, true);

          if (!$headers){
            echo "Force uploading fot NON-SSL Servers/Direct Admin hosts ...";
            ob_end_flush();
            ob_flush();
            flush();
            ob_start();
            $ch = curl_init($url);
            $fp = fopen($name, 'wb');
            curl_setopt($ch, CURLOPT_FILE, $fp);
            curl_setopt($ch, CURLOPT_HEADER, 0);
            curl_exec($ch);
            curl_close($ch);
            fclose($fp);
            die(" / Upload complete!");
          }

          stream_context_set_default(array('http' => array('method' => 'HEAD')));
          $headers = array_change_key_case(get_headers($url, 1));
          $filesize = $headers['content-length'];
          ob_end_flush();
          ob_flush();
          flush();
          ob_start();
          $read_bytes = 0;
          $num   = 0;
          $steps = floor($filesize/2048)/300;
          while(!feof($remote)) {
              $buffer = fread($remote, 2048);
              fwrite($local, $buffer);
              $read_bytes += 2048; $num++;
              if ($num % $steps == 0 ) {
                  $progress = min(100, 100 * $read_bytes / $filesize);
                  echo "<script>
                  document.title = 'Uploading ".sprintf("%'05.2f%%", $progress)."';
                  document.querySelector('#progress').innerHTML = '( ".sprintf("%'05.2f%%", $progress)." â ".human_filesize($read_bytes)." / ".human_filesize($filesize)." )<br><small style=\"text-transform: capitalize;\">Elapsed Time: ".human_timing($time)."</small>';
                  document.querySelector('body').style.backgroundImage = 'linear-gradient(to right, rgba(0, 223, 56, 0.18) $progress%, white $progress%)';
                  </script>";
              }
              ob_end_flush();
              ob_flush();
              flush();
              ob_start();
          }
          fclose($remote);
          fclose($local);

          echo "<script>
          document.title = 'Transferring Done!';
          document.querySelector('#progress').innerHTML = '( 100.00% â ".human_filesize($filesize)." / ".human_filesize($filesize)." )<br><small style=\"text-transform: capitalize;\">Total Time: ".human_timing($time)."</small>';
          document.querySelector('body').style.backgroundImage = 'linear-gradient(to right, rgba(0, 223, 56, 0.18) $progress%, white $progress%)';
          document.querySelector('h1').innerHTML += '<div style=\"font-size: 0;margin-bottom: 3rem;\"><small style=\"font-size: 1rem;font-family: initial;font-weight: initial;\">â Transferring Done! ð</small></div>';
          document.querySelector('h1').innerHTML += '<div style=\"font-size: 0;margin-bottom: 3rem;\"><small style=\"font-size: 1rem;font-family: initial;font-weight: initial;\"><a href=\"?r=".time()."\" style=\"background: #0060df;color: white;text-decoration: none; padding: 0.5rem 2rem;border: none;border-radius: 3px;box-shadow: 0 0 8px -3px #00000069;margin: 0 1rem;cursor: pointer;\">Upload another file</a></small></div>';
          </script>";
          ob_end_flush();
          exit;
      }
      function human_filesize($bytes, $decimals = 2)
      {
          if (!$bytes || $bytes < 1) {
              return "ERR";
          }
          $sz = 'BKMGTP';
          $factor = floor((strlen($bytes) - 1) / 3);
          return sprintf("%'05.{$decimals}f", $bytes / pow(1024, $factor)) . @$sz[$factor];
      }
      function human_timing($time)
      {
        $s = microtime(true) - $time;
        $h = floor($s / 3600);
        $s -= $h * 3600;
        $m = floor($s / 60);
        $s -= $m * 60;
        return ($h > 0 ? "$h:" : "") .sprintf('%02d', $m).':'.sprintf('%02d', $s);
      }
